import React, { useState, useEffect } from "react";
import Tittle from '../Titlte';
import { VerticalTimeline, VerticalTimelineElement }  from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';
 import { MdWork } from 'react-icons/md';
 import { MdSchool } from 'react-icons/md';
 
 import { getAlleducation, deleteEducation } from "../../admin/helper/adminapicall";
import { isAutheticated } from "../../auth/helper";





const RemusePage = () => {


  const [educations, setEducations] = useState([]);


  const preload = () => {
    getAlleducation().then(data => {
      if (data.error) {
        console.log(data.error);
      } else {
        setEducations(data);
      }
    });
  };

  useEffect(() => {
    preload();
  }, []);


  {educations.map((education, index) => {
  return (
    <div key={index} >
    <Tittle title={'Qualification'} span={'Qualification'} />
    <br />
<VerticalTimeline>
<VerticalTimelineElement
    className="vertical-timeline-element--work"
    contentStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
    contentArrowStyle={{ borderRight: '7px solid  rgb(33, 150, 243)' }}
   
    dateStyle={{backgroundColor : "red"}}
  
    iconStyle={{ background: 'rgb(33, 100, 243)', color: '#fff'  }}
    icon ={<MdSchool />}
  >
      <span class="w3-tag w3-green">{education.year}</span>
      <span class="w3-tag w3-green" style={{float:"right"}}>{education.qualification}</span>
      <br />
    {/*<h3 className="vertical-timeline-element-title"></h3>*/}
    <h4 className="vertical-timeline-element-subtitle">{education.name}</h4>
    <p>
      {education.board}
    </p>
    
  </VerticalTimelineElement>
  
  <VerticalTimelineElement
    iconStyle={{ background: 'rgb(16, 204, 82)', color: '#fff' }}
  
  />
</VerticalTimeline>
<div class="back-to-top-wrapper">
    <a href="#top" class="back-to-top-link" aria-label="Scroll to Top">🔝</a>
  </div>
</div>

  );
  })};
  }

  export default RemusePage;
